const NDA = () => {
  return (
    <div className="nda">
      <h4>비밀 유지 계약서</h4>
      <p>이 계약서는 다음과 같은 조건을 포함합니다...</p>
      {/* 비밀 유지 계약서의 상세 내용 추가 */}
    </div>
  );
};

export default NDA;
